import React from 'react';
import './App.css';
import Categories from './Categories'
import Tasks from './Tasks'

class App extends React.Component {

  render() {
    return (
      <div className="App">
        <h2>My tasks</h2>
        <Categories />
        <div className="tasks">
          <h5>Tasks</h5>
          <Tasks />
        </div>
      </div>
    );
  }
}


export default App;
